const App = () => {
	return (
		<>
			<Header />
			<main>
				<Home />
				<button onClick={toggleCanvas} style={styles.miniview}>
					Smiley Face
				</button>
				<div className="mini-view">{showCanvas && <CanvasWidget />}</div>
			</main>
			<Footer />
		</>
	);
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
